from itertools import groupby, product
def adr(s):
    runs = [(k, len(list(g))) for k, g in groupby(s)]
    return len(runs) == len(set(runs))
def a(n):
    if n == 0: return 1
    return 2*sum(adr("1"+"".join(w)) for w in product("01", repeat=n-1))
